// ProjectSelection.js
import React, { useEffect, useState } from 'react';
import { Container, Typography, Box, CircularProgress, Grid, Card, CardContent, Button } from '@mui/material';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import config from '../config';

const ProjectSelection = () => {
  const [projects, setProjects] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const navigate = useNavigate();

  useEffect(() => {
    const fetchProjects = async () => {
      try {
        const response = await axios.get(`${config.API_URL}/proyecto`, {
          withCredentials: true,
        });
        setProjects(response.data.data);
        setLoading(false);
      } catch (error) {
        console.error('Error fetching projects:', error);
        setError('Error fetching projects');
        setLoading(false);
      }
    };

    fetchProjects();
  }, []);

  const handleProjectClick = (projectId) => {
    navigate(`/dashboard/project/${projectId}`);
  };

  return (
    <Container>
      <Typography variant="h4" gutterBottom>Seleccionar Proyecto</Typography>
      {loading ? (
        <Box sx={{ display: 'flex', justifyContent: 'center', mt: 4 }}>
          <CircularProgress />
        </Box>
      ) : (
        <Grid container spacing={3}>
          {error && <Typography color="error">{error}</Typography>}
          {projects.length > 0 ? (
            projects.map((project) => (
              <Grid item xs={12} sm={6} md={4} key={project._id}>
                <Card>
                  <CardContent>
                    <Typography variant="h6">{project.nombre}</Typography>
                    <Typography variant="body2">{project.descripcion}</Typography>
                    <Button
                      variant="contained"
                      color="primary"
                      sx={{ mt: 2 }}
                      onClick={() => handleProjectClick(project._id)}
                    >
                      Ver Proyecto
                    </Button>
                  </CardContent>
                </Card>
              </Grid>
            ))
          ) : (
            <Typography>No se encontraron proyectos</Typography>
          )}
        </Grid>
      )}
    </Container>
  );
};

export default ProjectSelection;
